import React, { Component } from "react";
class Body extends Component
{
    render()
    {
        return(
            <div style={{height:'200px'}}>
                <br/>
                <div className="h-100 shadow-lg p-4 mb-4 bg-white container text-center">

                        <h1><b>
                            <span >Wallet as a Service</span>
                        </b></h1>


                    <a href={"/log"}><button className="btn btn-dark" >Click to login</button></a>
                    <br/>
                    <br/>

                    <a href={"/register"}><button className="btn btn-dark">Click to Register</button></a>

                </div>
            </div>
        )
    }
}
export default Body;
